const MY_KEY = '0add6da0-058c-491e-b604-c77b7ca63e75';

export default async function userFetch() {
    const URL = `https://api.fortnitetracker.com/v1/powerrankings/pc/NAE/Ninja`;

    try {
        const response = await fetch(URL, {
            "TRN-Api-Key": MY_KEY,
            'method': 'GET',
            'mode': 'no-cors',
            'headers': {
                'Authorization': 'Basic ' + btoa({"TRN-Api-Key": MY_KEY}),
              }
        })

        const data = await response.json();
        console.log(data);
        return data;

    } catch (error) {
        return Error(error)
    }


}
